>'Abgelesener Wert','View Meter'=>'Zähler ansehen','View Plot'=>'Parzelle ansehen','Warning! These users hold unavailble positions:'=>'Achtung! Diese Benutzer haben nicht verfügbare Ämter/Funktionen:','We have a new post for you'=>'Wir haben einen neuen Beitrag für dich','You are already logged in. No need to register for you..'=>'Du bist schon angemeldet. Kein Bedarf, dich nochmal zu registrieren.','You can copy these to prepare your CSV file. Remove the headines before upload.'=>'Du kannst diese Tabelle kopieren, um deine CSV-Datei vorzubereiten. Entferne die Überschriften, bevor du sie hochlädtst.','You can read these posts exclusively as a registered member.'=>'Diese Inhalte sind exklusiv für Mitglieder bestimmt.','You do not have any positions in this club.'=>'Du bekleidest kein Amt bzw. keine Funktion in diesem Verein.','You have been logged out. See you soon!'=>'Du hast dich erfolgreich abgemeldet. Bis bald!','You have no permission to deactivate this token.'=>'Du hast nicht die nötige Berechtigung, um diesen Token zu löschen.','You have not defined a directory for temporary file uploads. You cannot use this function.'=>'Du hast kein Verzeichnis für temporäre Uploads definiert. Du kannst diese Funktion nicht nutzen.','You have to create at least one plot.'=>'Du musst mindestens eine Parzelle erzeugen.','You may not send readings for plots that are not assigned to you.'=>'Du darfst keine Zählerstände für Zähler übermitteln, die dir nicht zugewiesen sind.','Your Member Profile'=>'Dein Benutzerprofil','Your member profile contains these settings.'=>'Dein Benutzerprofil enthält die folgenden Einstellungen.','Your Plot'=>'Deine Parzelle','Your user account has been activated - %s'=>'Dein Benutzerkonto wurde aktiviert - %s','Your user account on %s has been activated.'=>'Dein Benutzerkonto auf %s wurde aktiviert.']];
